import React, {Fragment} from 'react';

const Question = (items) => {
    console.log(items)
    return(
      <Fragment>
          {items.map((item) => (
               <div key={item.id} className='question-wrapper'>
                   {item.text}
               </div>
          ))}
      </Fragment>
    )
}

export default Question;
